          s -> 9e1f3a6b8c2d4e7f1a9b3c6d8e2f5a7b
          v -> 9c



    Bits e Bytes na Computação

    - 1B = 8b

    - B = Byte | b = bit

    - Cada caracter A|B|C|D|E|F|G|H|I|J|... eles precisam de 1 Byte para ser expreso, armazenado. Isso é, 1 Byte para o A para o B para o C.

